import PropTypes from 'prop-types';
import React from 'react';
import { List } from 'immutable';

//Material-UI components
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import Button from '@material-ui/core/Button';
import Slide from '@material-ui/core/Slide';

function Transition(props) {
    return <Slide direction="up" {...props} />;
}

const NewProductDialog = ({ newProduct, title, actions }) => (
    <Dialog
        open={this.state.newProduct}
        TransitionComponent={Transition}
        keepMounted
        onClose={this.handleClose}
        aria-labelledby="alert-dialog-slide-title"
        aria-describedby="alert-dialog-slide-description"
    >
        <DialogTitle id="alert-dialog-slide-title">
            {this.props.title}
        </DialogTitle>
        <DialogContent>
            <DialogContentText id="alert-dialog-slide-description">
                Let Google help apps determine location. This means sending anonymous location data to
                Google, even when no apps are running.
            </DialogContentText>
        </DialogContent>
        <DialogActions>
            <Button onClick={this.actions[0]} color="primary">
                Dodaj
            </Button>
            <Button onClick={this.actions[1]} color="primary">
                Anuluj
            </Button>
        </DialogActions>
    </Dialog>
);

NewProductDialog.propTypes = {
    newProduct: PropTypes.bool.isRequired,
    title: PropTypes.string,
    actions: PropTypes.arrayOf(
        PropTypes.shape({})
    ).isRequired
};

NewProductDialog.defaultProps = {
    title: ''
};

export default NewProductDialog;
